How `agenda.js` calculates timezone for `every()` operation<p>I am using <code>agenda.js</code> in my Node project, backed with a MongoDB database, to handle batch processes we need to run. This is working well. I do have a question about timezones, however. When I use the <code>every()</code> operation, it seems like it accepts the job name, and the schedule. So I have been seeding jobs to the database like so:</p>

<pre><code>  for (let job of dbJobs) {
    await agenda.every(schedule, job.name);
  }
</code></pre>

<p>Note that for the above, <code>schedule</code> is in cron format -- <code>00 05 * * 1-5</code>.</p>

<p>This works. However, from what I can tell, <code>every()</code> doesn't accept an argument for <code>repeatTimezone</code>. So what does it do to calculate the timezone in those cases?</p>

<p>To clarify, when I look at the document in the database after the job has been added using <code>every()</code>, the <code>repeatTimezone</code> property exists, but its value is set to <code>null</code>.</p>

<p>Other <code>agenda</code> operations, like <code>repeatEvery()</code>, <em>do</em> accept an argument for timezone, like so:</p>

<pre><code>job.repeatEvery('0 6 * * *', {
  timezone: 'America/New_York'
});
</code></pre>

<p>Since I'm using <code>every()</code>, I have been managing this by first seeding the database using <code>every()</code>, and then running a Mongo <code>updateMany()</code> to add the timzeone explicitly to all jobs:</p>

<pre><code>async function addTimezoneToJobs() {
  try {
    const db = await client.db(dbName);
    await db.collection('batch_processes').updateMany({}, {
      $set: {
        repeatTimezone: 'America/New_York'
      }
    });
  } catch (error) {
    console.log(error);
  }
}
</code></pre>

<p>But strangely enough, <code>agenda</code> seems to calculate the same time even when I don't explicitly add the <code>repeatTimezone</code> property value to the jobs as when I do.</p>

<p>What's happening here that I'm not understanding? How is the runtime calculated with <code>every()</code>, and is there a way to pass in timezone?</p>

<p>FYI: I am not in the same timezone as that which needs to be set in the db.</p>

