  unique., <strong>_id</strong>: Error, expected _id to be unique."</p>
</blockquote>

<p>They said the <strong>Email</strong> and <strong>_id</strong> are not unique. But.., <strong>_id</strong> is an auto-generated value to be unique in MongoDB meaning that it should not be detected as a duplicated value. </p>

<p>I am not sure if that was caused by my own implementation so I would look forward to see any assumption or ways to debug to the root cause of this too. I tried restarting from fresh Mongo DB and manually inputting uniquely via Postman but still no hope.</p>

<p>These are a part of the codes that might be related to the data creation on MongoDB</p>

<p><strong>UserModel.js</strong></p>

<pre><code>var uniqueValidator = require('mongoose-unique-validator');

const { Schema } = mongoose;

const UsersSchema = new Schema({
  email: { type: String, unique: true, required: true},
  hashedPassword: String,
  salt: String,
});

UsersSchema.plugin(uniqueValidator, { message: 'Error, expected {PATH} to be unique.' });
UsersSchema.set('autoIndex', false);
</code></pre>

<p><strong>Server.js ---- /api/users/register</strong></p>

<pre><code>const finalUser = new Users(user);
