<p>I tried this solution from <a href="https://stackoverflow.com/questions/13580589/mongoose-unique-validation-error-type">Sritam</a> to detect another email with the same value but it still claims that the inputted email is already existed.</p>

<pre><code>UsersSchema.path('email').validate(async (value) =&gt; {
  const emailCount = await mongoose.models.User.countDocuments({email: value });
  return !emailCount;
}, 'Email already exists');
