Embed Field: Is it a bad idea to construct mongodb query in front-end?<p>In the frontend, stringify below</p>

<pre><code>{ options: { $or: [ id1, id2, id3 ], foo: { $gte: bar} } }
</code></pre>

<p>And in the backend</p>

<p>Use that directly in <code>SomeCol.Find(req.params.options)</code></p>

<p>Of course  with validation/sanitization</p>

<p><strong>Edit</strong></p>

<p>I was planning to whitelist what user can query in the backend</p>

<pre><code>// pseudo validator schema
{
  $or: isArrayOf({ _id: MongoId }),
  foo: isObject({
    $gte: isNumber()
  })
}
</code></pre>

<p>If query from front-end does not meet that schema, it stops there.
And since I'm always running <code>find()</code> for <code>GET Method</code> (so not inserting), I thought this would be convenient. </p>

<p>Still sketchy?</p>; Answer: Nice solution but the polyfill does not submit the name / value of a `<button>` element (e.g. Chrome 48). You need to add some code to add a hidden field before the line `// browser supports it, no need to fix
    return;buttons`. The code may look like `if ($(sampleElement).attr("form") == $fields.attr("id") && $(sampleElement).is("[name]"))
  {
    $(sampleElement).click(function() {
      self._appendField($form, {name: $(sampleElement).attr("name"), value: $(sampleElement).val()});                      
    });
  }`

