I'm struggling to use front-end JS and EJS in harmony with this as the selection needs to be made on the front end and posted to the back-end through the html form, I assume with an array that includes my image selections.
My code makes an array called 'imageSelection' to store the images picked by the user with JS, and then it attempts to JSON stringify and POST the array to the server for processing.</p>

<p>I was able to save the images in an array with JS, and to use a foreach to cycle through the ones from my database to display the options with EJS. I can then only figure out how to POST static data but that doesn't work in the way I need it to since I want to post the image selection array after stringifying it. I seem to be unable to use plain JS to stringify and post the data I store in my array in vanilla JS because I need to call a function and then insert the data into the submitted value. I'm not sure this is the only problem with my code here though.</p>

<p>I have a preview of the chosen images, which should display but I can't use my former code because it works with EJS, and it needs to work with plain JS to access my 'imageSelection' array. </p>

<pre><code>    &lt;form action="/post-add-imgs" method="post"&gt;
  &lt;div class="dropdown"&gt;
    &lt;button class="btn btn-primary" type="button" data-toggle="dropdown"&gt;Select a Post
    &lt;span class="caret"&gt;&lt;/span&gt;&lt;/button&gt;
    &lt;ul class="dropdown-menu  hover_img"&gt;
      &lt;%  posts.forEach(function(post){ %&gt;
        &lt;li&gt;&lt;a href="#"&gt;&lt;%=post.title%&gt;&lt;/a&gt;&lt;/li&gt;
        &lt;% }); %&gt;
    &lt;/ul&gt;
    &lt;/div&gt;

  &lt;div class="uploads-gallery"&gt;
    &lt;%  images.forEach(function(image){ %&gt;
      &lt;a href="#" onclick=" addImage(&lt;%=image.url%&gt;); "&gt;&lt;img src="&lt;%=image.url%&gt;" alt="preview image" 
  height="100" /&gt;&lt;/a&gt;
      &lt;% }); %&gt;
  &lt;/div&gt;

  &lt;input type="hidden" name=" imageSelection " value="json.stringify(imageSelection);"&gt;
  &lt;button type="submit" name="button"&gt;Add image choice&lt;/button&gt;
  &lt;/form&gt;
</code></pre>

<p>Is there a way to use ejs to display the selected images, and then to post them on after a json.stringify?
Will I need to use ajax to accomplish this?</p>

<p>Thanks for all help, and wise words.</p>

