<p><strong>Comment Model</strong></p>

<pre><code>const commentSchema = mongoose.Schema({
  comment: { type: String, required: true },
  blog: {
    type: mongoose.Schema.Types.ObjectId,
    ref: "Blog"
  }
});

commentSchema.set("toJSON", {
  transform: (document, returnedObject) =&gt; {
    returnedObject.id = returnedObject._id.toString();
    delete returnedObject._id;
    delete returnedObject.__v;
  }
});

module.exports = mongoose.model("Comment", commentSchema);
</code></pre>

<p><strong>Blog Model</strong></p>

<pre><code>const blogSchema = mongoose.Schema({
  title: { type: String, required: true },
  author: { type: String, required: true },
  url: String,
  likes: Number,
  user: {
    type: mongoose.Schema.Types.ObjectId,
    ref: "User"
  },
  comments: {
    type: mongoose.Schema.Types.ObjectId,
    ref: "Comment"
  }
});

blogSchema.set("toJSON", {
  transform: (document, returnedObject) =&gt; {
    returnedObject.id = returnedObject._id.toString();
    delete returnedObject._id;
    delete returnedObject.__v;
  }
});
</code></pre>

<p><strong>My Express Code where I'm trying to add a new comment</strong></p>

<pre><code>blogsRouter.post("/:id/comments", async (request, response, next) =&gt; {
